        })
    }

    render() {
        return (
            <div style={{padding: '40px'}}>
                <div className="card">
                    <DataTable value={this.state.products}>
                        <Column field="code" header="Submission Date"></Column>
                        <Column field="name" header="Company Name"></Column>
                        <Column field="category" header="Content"></Column>
                        <Column field="quantity" header="Original Image"></Column>
                    </DataTable>
                </div>
            </div>
        )
    }
}
